  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'Octopus 开发指南',
	description: 'Octopus 借鉴了Maven，并基于make提供了一组项目构建管理工具。 生成管理过程包含多个阶段，一个阶段包含多个操作。 为了方便起见，动作的名称也代表当前阶段。 动作的总体流程关系如下所示',
	keywords: [
		'Octopus中文文档',
		'Octopus 中文文档',
		'边缘计算',
		'IOT',
		'edge computing',
		'Octopus中文',
		'Octopus 中文',
		'Octopus',
		'Octopus教程',
		'Octopus中国',
		'rancher',
		'Octopus 中文教程',
		'适配器',
		'Octopus 开发指南'
	]
};
export const metadata = {
  "id": "octopus/develop/_index",
  "title": "Octopus 开发指南",
  "description": "Octopus 借鉴了Maven，并基于make提供了一组项目构建管理工具。 生成管理过程包含多个阶段，一个阶段包含多个操作。 为了方便起见，动作的名称也代表当前阶段。 动作的总体流程关系如下所示",
  "source": "@site/docs/octopus/develop/_index.md",
  "permalink": "/docs/octopus/develop/_index",
  "editUrl": "https://github.com/cnrancher/docs-rancher2/edit/master/docs/octopus/develop/_index.md",
  "lastUpdatedBy": "Author",
  "lastUpdatedAt": 1539502055
};
  /* @jsx mdx */

export const rightToc = [{
  value: '建立 Octopus 管理流程',
  id: '建立-octopus-管理流程',
  children: [{
    value: '使用案例',
    id: '使用案例',
    children: []
  }, {
    value: '注意事项',
    id: '注意事项',
    children: []
  }]
}, {
  value: '适配器的生成管理',
  id: '适配器的生成管理',
  children: []
}, {
  value: '所有组件的构建管理',
  id: '所有组件的构建管理',
  children: []
}, {
  value: '贡献者工作流程',
  id: '贡献者工作流程',
  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h2 {...{
      "id": "建立-octopus-管理流程"
    }}>{`建立 Octopus 管理流程`}</h2>
    <p>{`Octopus 借鉴了`}<a parentName="p" {...{
        "href": "https://maven.apache.org/"
      }}>{`Maven`}</a>{`，并基于`}<a parentName="p" {...{
        "href": "https://www.gnu.org/software/make/manual/make.html"
      }}>{`make`}</a>{`提供了一组项目构建管理工具。 生成管理过程包含多个阶段，一个阶段包含多个操作。 为了方便起见，动作的名称也代表当前阶段。 动作的总体流程关系如下所示：`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`          generate -> mod -> lint -> build -> package -> deploy
                                         \\ -> test -> verify -> e2e
`}</code></pre>
    <p>{`每个动作的说明：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`动作名称/当前阶段`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`作用`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`generate`}</inlineCode>{`, `}<inlineCode parentName="td">{`gen`}</inlineCode>{`, `}<inlineCode parentName="td">{`g`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`通过`}<a parentName="td" {...{
              "href": "https://github.com/kubernetes-sigs/controller-tools/blob/master/cmd/controller-gen/main.go"
            }}><inlineCode parentName="a">{`controller-gen`}</inlineCode></a>{`生成`}<inlineCode parentName="td">{`octopus`}</inlineCode>{`的部署清单和 deepcopy/runtime.Object 实现；通过`}<a parentName="td" {...{
              "href": "https://github.com/protocolbuffers/protobuf"
            }}><inlineCode parentName="a">{`protoc`}</inlineCode></a>{`生成`}<inlineCode parentName="td">{`adaptor`}</inlineCode>{`接口的 proto 文件`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`mod`}</inlineCode>{`, `}<inlineCode parentName="td">{`m`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`下载 Octopus 的依赖文件`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`lint`}</inlineCode>{`, `}<inlineCode parentName="td">{`l`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`通过`}<a parentName="td" {...{
              "href": "https://github.com/golangci/golangci-lint"
            }}><inlineCode parentName="a">{`golangci-lint`}</inlineCode></a>{`来验证`}<inlineCode parentName="td">{`octopus`}</inlineCode>{`，如果安装失败，则回滚到`}<inlineCode parentName="td">{`go fmt`}</inlineCode>{`和`}<inlineCode parentName="td">{`go vet`}</inlineCode>{`。<br/`}<br />{` 使用`}<inlineCode parentName="td">{`DIRTY_CHECK=true`}</inlineCode>{`验证整个项目是否在 dirty tree 中。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`build`}</inlineCode>{`, `}<inlineCode parentName="td">{`b`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`根据操作系统的类型和架构编译`}<inlineCode parentName="td">{`octopus`}</inlineCode>{`，生成二进制文件到`}<inlineCode parentName="td">{`bin`}</inlineCode>{`目录。`}<br /><br />{` 使用 "CROSS=true "编译支持的平台的二进制文件(在这个 repo 中搜索`}<inlineCode parentName="td">{`constant.sh`}</inlineCode>{`文件)。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`test`}</inlineCode>{`, `}<inlineCode parentName="td">{`t`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`运行单元测试`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`verify`}</inlineCode>{`, `}<inlineCode parentName="td">{`v`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`使用 Kubernetes 集群运行集成测试。`}<br /><br />{` 使用`}<inlineCode parentName="td">{`CLUSTER_TYPE`}</inlineCode>{`来指定本地集群的类型，默认为`}<inlineCode parentName="td">{`k3d`}</inlineCode>{`。不需要设置本地集群，也可以使用环境变量`}<inlineCode parentName="td">{`USE_EXISTING_CLUSTER=true`}</inlineCode>{`指出一个现有的集群，然后集成测试将使用当前环境的 kubeconfig 与现有集群进行通信。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`package`}</inlineCode>{`, `}<inlineCode parentName="td">{`pkg`}</inlineCode>{`, `}<inlineCode parentName="td">{`p`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`打包 Docker 镜像`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`e2e`}</inlineCode>{`, `}<inlineCode parentName="td">{`e`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`运行 E2E 测试`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`deploy`}</inlineCode>{`, `}<inlineCode parentName="td">{`dep`}</inlineCode>{`, `}<inlineCode parentName="td">{`d`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`推送 Docker 镜像并为当前版本创建 manifest 镜像。`}<br /><br />{` 使用`}<inlineCode parentName="td">{`WITHOUT_MANIFEST=true`}</inlineCode>{`防止推送 manifest 镜像，或者使用`}<inlineCode parentName="td">{`ONLY_MANIFEST=true`}</inlineCode>{`只推送 manifest 镜像，使用`}<inlineCode parentName="td">{`IGNORE_MISSING=true`}</inlineCode>{`在需要时对平台列表中定义的缺失镜像发出警告。`}</td>
        </tr>
      </tbody>
    </table>
    <p>{`执行一个阶段可以运行`}<inlineCode parentName="p">{`make octopus <stage name>`}</inlineCode>{`，例如，在执行`}<inlineCode parentName="p">{`test`}</inlineCode>{`阶段时，请运行`}<inlineCode parentName="p">{`make octopus test`}</inlineCode>{`。 要执行一个阶段，将执行先前顺序中的所有动作，如果运行`}<inlineCode parentName="p">{`make octopus test`}</inlineCode>{`，则实际上包括执行`}<inlineCode parentName="p">{`generate`}</inlineCode>{`，`}<inlineCode parentName="p">{`mod`}</inlineCode>{`，`}<inlineCode parentName="p">{`lint`}</inlineCode>{`，`}<inlineCode parentName="p">{`build`}</inlineCode>{`和`}<inlineCode parentName="p">{`test`}</inlineCode>{`动作。`}</p>
    <p>{`要通过添加`}<inlineCode parentName="p">{`only`}</inlineCode>{`命令来运行某个动作，例如，如果仅运行`}<inlineCode parentName="p">{`build`}</inlineCode>{`动作，请使用`}<inlineCode parentName="p">{`make octopus build only`}</inlineCode>{`。`}</p>
    <p>{`要组合多个动作，可以使用逗号列表，例如，如果要按顺序运行`}<inlineCode parentName="p">{`build`}</inlineCode>{`，`}<inlineCode parentName="p">{`package`}</inlineCode>{`和`}<inlineCode parentName="p">{`deploy`}</inlineCode>{`动作，请使用`}<inlineCode parentName="p">{`make octopus build，package，deploy`}</inlineCode>{`。`}</p>
    <p>{`通过`}<inlineCode parentName="p">{`BY`}</inlineCode>{`环境变量与`}<a parentName="p" {...{
        "href": "https://github.com/rancher/dapper"
      }}><inlineCode parentName="a">{`dapper`}</inlineCode></a>{`集成，例如，如果仅通过`}<a parentName="p" {...{
        "href": "https://github.com/rancher/dapper"
      }}><inlineCode parentName="a">{`dapper`}</inlineCode></a>{`运行`}<inlineCode parentName="p">{`build`}</inlineCode>{`动作，请使用`}<inlineCode parentName="p">{`BY=dapper make octopus build`}</inlineCode>{`。`}</p>
    <h3 {...{
      "id": "使用案例"
    }}>{`使用案例`}</h3>
    <p>{`假设在 Mac 上尝试以下示例：`}</p>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`在本地主机上运行，当前环境将安装其他依赖项。 如果任何安装失败，您将收到相应的警告。`}</p>
        <ul parentName="li">
          <li parentName="ul"><inlineCode parentName="li">{`make octopus build`}</inlineCode>{`：执行`}<inlineCode parentName="li">{`build`}</inlineCode>{`阶段，然后获取`}<inlineCode parentName="li">{`darwin/amd64`}</inlineCode>{` 的可执行二进制文件。`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`make octopus test only`}</inlineCode>{`：在`}<inlineCode parentName="li">{`darwin/amd64`}</inlineCode>{`平台上执行`}<inlineCode parentName="li">{`test`}</inlineCode>{` 动作。`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`REPO=somebody OS=linux ARCH=amd64 make octopus package`}</inlineCode>{`：执行`}<inlineCode parentName="li">{`package`}</inlineCode>{` 动作，完成后可获取`}<inlineCode parentName="li">{`linux/amd64`}</inlineCode>{` 的可执行二进制文件和一个 Repo 名为`}<inlineCode parentName="li">{`somebody`}</inlineCode>{`的 Octopus `}<inlineCode parentName="li">{`linux/amd64`}</inlineCode>{` 的镜像。`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`CLUSTER_TYPE=make octopus verify only`}</inlineCode>{`：使用`}<a parentName="li" {...{
              "href": "https://github.com/kubernetes-sigs/kind"
            }}><inlineCode parentName="a">{`kind`}</inlineCode></a>{`集群执行`}<inlineCode parentName="li">{`verify`}</inlineCode>{`操作。`}</li>
        </ul>
      </li>
      <li parentName="ol">
        <p parentName="li">{`在本地主机中支持多架构镜像。`}</p>
        <ul parentName="li">
          <li parentName="ul"><inlineCode parentName="li">{`CROSS=true make octopus build only`}</inlineCode>{`： 执行`}<inlineCode parentName="li">{`build`}</inlineCode>{` 操作，然后获取受支持平台的所有执行二进制文件。`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`CROSS=true make octopus test only`}</inlineCode>{`： `}<em parentName="li">{`目前不支持交叉平台测试`}</em>{`。`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`CROSS=true REPO=somebody make octopus package only`}</inlineCode>{`： 执行`}<inlineCode parentName="li">{`package`}</inlineCode>{` 操作，指定镜像的组织名为`}<inlineCode parentName="li">{`somebody`}</inlineCode>{` 并构建所有支持的平台的镜像。`}<ul parentName="li">
              <li parentName="ul"><inlineCode parentName="li">{`make octopus package only`}</inlineCode>{`： `}<em parentName="li">{`当前不支持`}<inlineCode parentName="em">{`darwin`}</inlineCode>{` 平台的镜像`}</em>{`.`}</li>
            </ul></li>
          <li parentName="ul"><inlineCode parentName="li">{`CROSS=true REPO=somebody make octopus deploy only`}</inlineCode>{`： 执行`}<inlineCode parentName="li">{`deploy`}</inlineCode>{` 操作，然后将所有支持的平台的镜像推送至`}<inlineCode parentName="li">{`somebody`}</inlineCode>{` 仓库，并且创建当前版本的`}<a parentName="li" {...{
              "href": "https://docs.docker.com/engine/reference/commandline/manifest/"
            }}>{`Manifest 文件`}</a>{`.`}<ul parentName="li">
              <li parentName="ul"><inlineCode parentName="li">{`make octopus deploy only`}</inlineCode>{`： `}<em parentName="li">{`当前不支持`}<inlineCode parentName="em">{`darwin`}</inlineCode>{` 平台镜像`}</em>{`.`}</li>
            </ul></li>
        </ul>
      </li>
      <li parentName="ol">
        <p parentName="li">{`在`}<a parentName="p" {...{
            "href": "https://github.com/rancher/dapper"
          }}><inlineCode parentName="a">{`dapper`}</inlineCode></a>{`模式下构建，当前环境中不需要其他依赖项，这类选项适合于构造 CI/CD，并具有良好的环境可移植性。`}</p>
        <ul parentName="li">
          <li parentName="ul"><inlineCode parentName="li">{`BY=dapper make octopus build`}</inlineCode>{`：执行`}<inlineCode parentName="li">{`build`}</inlineCode>{` 阶段，然后获取`}<inlineCode parentName="li">{`linux/amd64`}</inlineCode>{` 可执行二进制文件。`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`BY=dapper make octopus test`}</inlineCode>{`：在`}<inlineCode parentName="li">{`linux/amd64`}</inlineCode>{`平台上执行`}<inlineCode parentName="li">{`test`}</inlineCode>{` 操作。`}</li>
          <li parentName="ul"><inlineCode parentName="li">{`BY=dapper REPO=somebody make octopus package only`}</inlineCode>{`：执行`}<inlineCode parentName="li">{`package`}</inlineCode>{` 操作并获得`}<inlineCode parentName="li">{`linux/amd64`}</inlineCode>{`架构和组织名为`}<inlineCode parentName="li">{`sombody`}</inlineCode>{`的镜像。`}</li>
        </ul>
      </li>
    </ol>
    <h3 {...{
      "id": "注意事项"
    }}>{`注意事项`}</h3>
    <p>{`在`}<a parentName="p" {...{
        "href": "https://github.com/rancher/dapper"
      }}><inlineCode parentName="a">{`dapper`}</inlineCode></a>{`模式下：`}</p>
    <ul>
      <li parentName="ul"><strong parentName="li">{`不允许使用`}</strong>{` `}<inlineCode parentName="li">{`USE_EXISTING_CLUSTER=true`}</inlineCode>{`。`}</li>
    </ul>
    <h2 {...{
      "id": "适配器的生成管理"
    }}>{`适配器的生成管理`}</h2>
    <p>{`适配器的构建管理与 Octopus 相似，但执行方式不同。 执行任何适配器的阶段都可以运行`}<inlineCode parentName="p">{`make adapter <适配器名称> <阶段名称>`}</inlineCode>{`。 请查看`}<a parentName="p" {...{
        "href": "/docs/octopus/adaptors/develop/_index"
      }}>{`开发适配器`}</a>{`了解更多详细信息。`}</p>
    <h2 {...{
      "id": "所有组件的构建管理"
    }}>{`所有组件的构建管理`}</h2>
    <p>{`随着组件的增加，一个接一个地构建它们的操作变得更加麻烦。 因此，通过指定阶段或动作，构建管理对所有组件执行相同的阶段或动作。 例如，运行`}<inlineCode parentName="p">{`make all test`}</inlineCode>{`将执行 Octopus 和所有适配器的`}<inlineCode parentName="p">{`test`}</inlineCode>{`阶段。 要执行一个动作，只需输入一个`}<inlineCode parentName="p">{`only`}</inlineCode>{`后缀命令即可。`}</p>
    <h2 {...{
      "id": "贡献者工作流程"
    }}>{`贡献者工作流程`}</h2>
    <p>{`欢迎进行贡献，请查看`}<a parentName="p" {...{
        "href": "https://github.com/cnrancher/octopus/blob/master/CONTRIBUTING.md"
      }}>{`CONTRIBUTING`}</a>{`以获取更多详细信息。`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
